import React, { Component } from "react";
var tempX = 0;
var tempY = 0;

export default class Dot extends Component {
  componentDidMount() {
    function getMouseXY(e) {
      tempX = e.pageX;
      tempY = e.pageY;

      console.log(tempY, tempX);
    }
    getMouseXY();
  }
  render() {
    return <div></div>;
  }
}
